	•	Показувати повний список усіх пасажирських маршрутів міста та переглядати іх на мапі з зупинками та онлайн анімацією пересування транспортних засобів;
	•	Переглядати інформацію про маршрут (актуальна інформація про перевізника, режим роботи, вартість, відстань);
	•	Заносити будь-які обрані маршрути та зупинки в обрані («улюблені»);
	•	Відслідковувати на мапі декілька маршрутів одночасно (для швидкого доступу до них);
	•	Сплачувати проїздні квитки онлайн за допомогою послуг Приватбанка;
	•	Отримувати екстрені повідомлення безпосередньо від диспетчерського центру міста;
	•	Змінювати мову інтерфейсу. - переглядати маршруту на карті
